import React from "react";

function Stats() {
  return (
    <div className="stats-details">
      <div>
        <p>IP Address</p>
      </div>
      <div>
        <p>Location</p>
      </div>
      <div>
        <p>TimeZone</p>
      </div>
      <div>
        <p>ISP</p>
      </div>
    </div>
  );
}

export default Stats;
